"intro_title":"Client Hello Details",
"intro_detail":"To start the Handshake and once a connection is established between the Client and the Server, our Client sends some information into the public Internet hoping that it will reach the intended Server.<br/> <br/> In general, the “letter” sent to the Server is very basic, and of no harm for the concerned parties. However, even if it is still publicly accessible, all the data is relevant. <br/> <br/>In particular, the ones that will play an important role later to ensure confidentiality are:<br/> <br/> (1) The Ciphers<br/> <br/> (2) The Client Random<br/> <br/> Hover en click on the image to find more!<br/> <br/> <br/> <br/> <br/> ",
