  "id":"g1",
  "title":"(1)",
  "desc":"<h1 class='xiatitle' style='font-size:1.3rem;'>Ciphers</h1><br/> <br/> <b>Ciphers</b> are “machines” (actually, operations) used to transform the data in the message into something that looks complete random, as well as bring that aparently random message back to the actual message. The Client wants the Server to know which machines the Client uses, so it sends a list.<br/> <br/> Those ciphers get as inputs some dedicated type of numbers in order to work properly.<br/><br/>Common to the construction of those machines is the use of numbers that should be very hard to repeat, because they are random. Randomness also adds specificity to the transaction - “it is only for this Client and this Server during this specific data exchange”.",
