  "title":"(2)",
  "desc":"<h1 class='xiatitle' style='font-size:1.3rem;'>Client Random</h1><br/><br/>One of things that our Server and Client want to keep secret during the data exchange is the inputs of the ciphers. To do that, they will try to fabricate exactly the same inputs for their pre-negotiated cipher on their corresponding sides. To create those inputs, they need some random numbers.<br/><br/>The Client makes one of those random numbers (the <b>client random</b>) and add a copy to the details sent to the Server. <br/><br/> <b>Why is a copy sent to the Server?</b> Because in order to reach a similar functionality Client and Server should share all the required values.",
